(11, 1, 31, 'godina', 'nicolae', '<h2>Articolul 39. Atribuţiile secretarului</h2>\n\n<p>&nbsp;Secretarul &icirc;ndeplineşte, sub autoritatea primarului, următoarele atribuţii de bază:</p>\n\n<p><span style="color:#b6c57e">a) </span>asigură &icirc;nştiinţarea convocării consiliului local;<br />\n<span style="color:rgb(182, 197, 126)">b)&nbsp;</span>participă la şedinţele consiliului local;<br />\n<span style="color:rgb(182, 197, 126)">c)&nbsp;</span>avizează proiectele de decizii ale consiliului local şi contrasemnează deciziile;<br />\n<span style="color:rgb(182, 197, 126)">d)&nbsp;</span>asigură buna funcţionare a primăriei;<br />\n<span style="color:rgb(182, 197, 126)">e)&nbsp;</span>&nbsp;asigură efectuarea lucrărilor de secretariat;<br />\n<span style="color:rgb(182, 197, 126)">f)&nbsp;</span>pregăteşte materialele pe marginea problemelor supuse dezbaterii &icirc;n consiliul local;<br />\n<span style="color:rgb(182, 197, 126)">g)&nbsp;</span>comunică şi remite, &icirc;n termen de 5 zile, dacă legea nu prevede altfel, autorităţilor şi persoanelor interesate actele emise de consiliul local sau de primar;<br />\n<span style="color:rgb(182, 197, 126)">h)&nbsp;</span>asigură consultarea publică a proiectelor de decizii ale consiliului local şi de dispoziţii normative ale primarului, informarea publicului referitor la deciziile adoptate şi la dispoziţiile emise; [Art.39 al.(1), lit.h) &icirc;n redacţia LP72 din 04.05.10, <span style="color:rgb(182, 197, 126)">&nbsp;</span>MO94-97/11.06.10 art.270]<br />\n<span style="color:rgb(182, 197, 126)">j)&nbsp;</span>primeşte, distribuie şi &icirc;ntreţine corespondenţa;<br />\n<span style="color:rgb(182, 197, 126)">k)&nbsp;</span>eliberează extrase sau copii de pe orice act din arhiva consiliului local, &icirc;n afara celor care conţin informaţii secrete, stabilite potrivit legii, precum şi extrase şi copii de pe actele de stare civilă;<br />\n<span style="color:rgb(182, 197, 126)">l)&nbsp;</span>organizează, coordonează, poartă răspundere pentru activitatea serviciilor de stare civilă, de protecţie socială şi exercită, după caz, atribuţiile respective;<br />\n<span style="color:rgb(182, 197, 126)">m)&nbsp;</span>ţine evidenţa gospodăriilor ţărăneşti (de fermier) şi a asociaţiilor acestora conform registrului aprobat de Guvern;<br />\n<span style="color:rgb(182, 197, 126)">n)&nbsp;</span>păstrează şi aplică, după caz, sigiliul;<br />\n<span style="color:rgb(182, 197, 126)">o)&nbsp;</span>acordă ajutor consilierilor şi comisiilor consiliului local;</p>\n', '', '', 'ffd vcb xcvb xcvbxcv bvcbxcvbx', 'PLM', '', ''),
(12, 2, 31, '', '', '', '', '', '', '', '', ''),
