(52, 'Scopul serviciului public', '<p>Autorizaţia de funcționare este un act administrativ individual ce atestă dreptul titularului autorizaţiei de a desfăşura activitatea &icirc;n unitatea comercială şi/sau de prestări servicii &icirc;n locul (terenul, localul, incinta) stabilit, pentru o perioadă stabilită, cu respectarea obligatorie a condiţiilor de autorizare prevăzute de legislaţie.</p>\n', '', 37, 1, 1),
(53, '', '', '', 37, 2, 0),
(54, 'Planul încăperii nelocative actualizat', '<ol>\n	<li><a href="http://apl.localhost/page/markup/autorizatii">Cerere tipzată (descarcă)</a></li>\n	<li>Extrasul din Registrul de stat al persoanelor juridice și &icirc;ntreprinzătorilor individuali;</li>\n	<li>Certificatul de proprietate asupra imobilului cu destinaţie nelocativă, eliberat de către Oficiul cadastral teritorial. Pentru unităţile amplasate &icirc;n &icirc;ncăperi &icirc;nchiriate urmează să fie prezentat şi contractul de locaţiune;</li>\n	<li>Planul &icirc;ncăperii nelocative actualizat la OCT;</li>\n	<li>Schema de amplasare a unităţii comerciale (pentru gherete, tarabe şi alte unităţi mobile);</li>\n	<li>Contractul de locaţiune sau titlul de autentificare a deţinătorului de teren;</li>\n	<li>Autorizaţia sanitară de funcţionare, pentru toate tipurile de unităţi comerciale şi/sau prestare servicii, iar &icirc;n cazul autorizării magazinelor alimentare şi unităţilor de alimentaţie publică suplimentar şi asortimentul produselor comercializate; Autorizaţia sanitară veterinară de funcţionare</li>\n</ol>\n', 'planul-incaperii-nelocative-actualizat', 38, 1, 1),
