(74, 'PRELEGERE PUBLICĂ LA ULIM: ”POLITICA DE SECURITATE A STATELOR NEUTRE DIN EUROPA', '<p>O prelege memorabilă a prezentat recent la Universitatea Liberă Internaţională din Moldova profesorul Dr. Hanspeter Neuhold, de la Universitatea din Viena, directorul Programului de Masterat al Universităţii şi Academiei Diplomatice din Viena. Profesorul austriac a fost &icirc;nsoţit de c&acirc;ţiva diplomaţi din ţara sa, care de asemenea au răspuns cu amabilitate la &icirc;ntrebările studenţilor şi profesorilor ULIM -Dr. Karl Schramek, Ambasadorul Austriei la NATO, şi Ambasadorul Gerhard Jandl, Directorul Departamentului PoliticO prelege memorabilă a prezentat recent la Universitatea Liberă Internaţională din Moldova profesorul Dr. Hanspeter Neuhold, de la Universitatea din Viena, directorul Programului de Masterat al Universităţii şi Academiei Diplomatice din Viena. Profesorul austriac a fost &icirc;nsoţit de c&acirc;ţiva diplomaţi din ţara sa, care de asemenea au răspuns cu amabilitate la &icirc;ntrebările studenţilor şi profesorilor ULIM -Dr. Karl Schramek, Ambasadorul Austriei la NATO, şi Ambasadorul Gerhard Jandl, Directorul Departamentului PoliticO prelege memorabilă a prezentat recent la Universitatea Liberă Internaţională din Moldova profesorul Dr. Hanspeter Neuhold, de la Universitatea din Viena, directorul Programului de Masterat al Universităţii şi Academiei Diplomatice din Viena. Profesorul austriac a fost &icirc;nsoţit de c&acirc;ţiva diplomaţi din ţara sa, care de asemenea au răspuns cu amabilitate la &icirc;ntrebările studenţilor şi profesorilor ULIM -Dr. Karl Schramek, Ambasadorul Austriei la NATO, şi Ambasadorul Gerhard Jandl, Directorul Departamentului Politic</p>\n', 'prelegere-publica-la-ulim-politica-de-securitate-a-statelor-neutre-din-europa', 48, 1, 1),
(75, '', '', '', 48, 2, 0),
(76, 'PRELEGERE PUBLICĂ', '<p>Profesorul austriac a fost &icirc;nsoţit de c&acirc;ţiva diplomaţi din ţara sa, care de asemenea au răspuns cu amabilitate la &icirc;ntrebările studenţilor şi profesorilor ULIM -Dr. Karl Schramek, Ambasadorul Austriei la NATO, şi Ambasadorul Gerhard Jandl, Directorul Departamentului Politică de Securitate şi Politică Externă şi de Securitate Comună al MAE al Austriei.&nbsp;Profesorul austriac a fost &icirc;nsoţit de c&acirc;ţiva diplomaţi din ţara sa, care de asemenea au răspuns cu amabilitate la &icirc;ntrebările studenţilor şi profesorilor ULIM -Dr. Karl Schramek, Ambasadorul Austriei la NATO, şi Ambasadorul Gerhard Jandl, Directorul Departamentului Politică de Securitate şi Politică Externă şi de Securitate Comună al MAE al Austriei.&nbsp;Profesorul austriac a fost &icirc;nsoţit de c&acirc;ţiva diplomaţi din ţara sa, care de asemenea au răspuns cu amabilitate la &icirc;ntrebările studenţilor şi profesorilor ULIM -Dr. Karl Schramek, Ambasadorul Austriei la NATO, şi Ambasadorul Gerhard Jandl, Directorul Departamentului Politică de Securitate şi Politică Externă şi de Securitate Comună al MAE al Austriei.&nbsp;Profesorul austriac a fost &icirc;nsoţit de c&acirc;ţiva diplomaţi din ţara sa, care de asemenea au răspuns cu amabilitate la &icirc;ntrebările studenţilor şi profesorilor ULIM -Dr. Karl Schramek, Ambasadorul Austriei la NATO, şi Ambasadorul Gerhard Jandl, Directorul Departamentului Politică de Securitate şi Politică Externă şi de Securitate Comună al MAE al Austriei.</p>\n', 'prelegere-publica', 49, 1, 1),
