(172, 'ghdfhdfhdgf', '<p>Mai mulți locatari ai blocului de la Botanica a cărui mansardă a ars la &icirc;nceputul lunii mai au venit din nou la Primărie. Ei sunt nemulțumiți de faptul că lucrările de restabilire a acoperișului nu au &icirc;nceput &icirc;ncă. Autoritățile municipale dau &icirc;nsă asigurări că la mijlocul lunii septembrie lucrările vor fi finalizate.</p>\n\n<p>Locatarii blocului situat pe strada Independenței din capitală, a cărui mansardă a fost mistuită de flăcări &icirc;n luna mai susțin că muncitorii care acum demontează acoperișul vechi nu se grăbesc să finalizeze lucrările. Din această cauză oamenii sunt nevoiți să locuiască &icirc;n continuare &icirc;n apartament &icirc;n care plouă, iar pereţii sunt plini de igrasie:</p>\n\n<p>&quot;Nu e lucru care ar trebui făcut de oamenii care &icirc;și cunosc meseria dar sunt niște copii veniți de la țară să lucreze pentru 100 de lei. Cu așa meșteri noi nu o să avem acoperiș&quot;.</p>\n\n<p>&quot;Situația este dezastruoasă. C&acirc;t nu am fost două săptăm&acirc;ni, era imposibil să mai stai &icirc;n casă. Ieri am prelucrat din nou apartamentul cu antimucegai&quot;.</p>\n\n<p>&quot;Le-am scris autorităților municipale un demers. Ni s-a răspuns că termenul de executare a lucrărilor pe acoperiș este de 90 de zile. Vrem să știm c&acirc;t vor mai dura aceste lucrări și dacă trebuie să sufere oamenii&quot;.</p>\n\n<p>&Icirc;n cadrul ședinței Primăriei, autoritățile municipale au spus că lucrările de construcție ar putea &icirc;ncepe marţi.</p>\n\n<p>&quot;Agentul economic spune că o să se țină de cuv&acirc;nt și o să &icirc;ndeplinească totul conform graficului care l-a semnat. Adică astăzi trebuie să se finalizeze demolarea pentru ca să &icirc;nceapă a instala construcția&quot;, a spus șeful Direcției locativ-comunale, Petru Gontea.</p>\n\n<p>Primarul capitalei, Dorin Chirtoacă, le-a cerut responsabililor ca &icirc;n această săptăm&acirc;nă să &icirc;nceapă și evaluarea pagubelelor produse de incendiu și ploi. Iar şi pe cele suportate de proprietarii apartamentelor situate la etajele de jos: &rdquo;Pot &icirc;ncepe deja lucrările de reparație, primesc suma pentru compensații și acolo se poate introduce și două trei luni pentru chirie pentru a nu fi &icirc;ncurcate lucrurile&rdquo;.</p>\n\n<p>&#39;&#39;Pot &icirc;ncepe deja lucrările de reparație, primesc suma pentru compensații și acolo se poate introduce și două trei luni pentru chirie pentru a nu fi &icirc;ncurcate lucrurile. Trebuie de &icirc;nceput de la cazurile cele mai grave&quot;, a spus Dorin Chirtoacă.</p>\n\n<p>Pentru construcția acoperișului blocului, Primăria a alocat 3,5 milioane de lei.</p>\n', '155', 97, 1, 1),
(173, '', '', '', 97, 2, 0),
(174, '', '<p>Mai mulți locatari ai blocului de la Botanica a cărui mansardă a ars la &icirc;nceputul lunii mai au venit din nou la Primărie. Ei sunt nemulțumiți de faptul că lucrările de restabilire a acoperișului nu au &icirc;nceput &icirc;ncă. Autoritățile municipale dau &icirc;nsă asigurări că la mijlocul lunii septembrie lucrările vor fi finalizate.</p>\n\n<p>Locatarii blocului situat pe strada Independenței din capitală, a cărui mansardă a fost mistuită de flăcări &icirc;n luna mai susțin că muncitorii care acum demontează acoperișul vechi nu se grăbesc să finalizeze lucrările. Din această cauză oamenii sunt nevoiți să locuiască &icirc;n continuare &icirc;n apartament &icirc;n care plouă, iar pereţii sunt plini de igrasie:</p>\n\n<p>&quot;Nu e lucru care ar trebui făcut de oamenii care &icirc;și cunosc meseria dar sunt niște copii veniți de la țară să lucreze pentru 100 de lei. Cu așa meșteri noi nu o să avem acoperiș&quot;.</p>\n\n<p>&#39;&#39;Pot &icirc;ncepe deja lucrările de reparație, primesc suma pentru compensații și acolo se poate introduce și două trei luni pentru chirie pentru a nu fi &icirc;ncurcate lucrurile. Trebuie de &icirc;nceput de la cazurile cele mai grave&quot;, a spus Dorin Chirtoacă.</p>\n\n<p>Pentru construcția acoperișului blocului, Primăria a alocat 3,5 milioane de lei.</p>\n', '-157', 98, 1, 1),
