(292, 'Ghid de achitare a impozitelor', '<h2>Ghid practic: Cum se realizeaza plata online a taxelor si impozitelor?</h2>\n\n<p>De peste trei ani, contribuabilii au posibilitatea de a-si plati online taxele si impozitele, prin intermediul ghiseului virtual de plati. Conform reglementarilor in vigoare, sunt acceptate toate mijloacele electronice de plata online (internet banking, mobile banking, plata cu cardul), iar contribuabilii nu platesc comision atunci cand isi achita obligatiile in acest fel. Pentru ca la sfarsitul anului 2013, s-au introdus noi prevederi in domeniu, va prezentam astazi un ghid complet al procedurii de plata online a taxelor si impozitelor.</p>\n\n<h2>Plata online a taxelor si impozitelor</h2>\n\n<p>Conform portalului&nbsp;<a href="https://www.ghiseul.ro/ghiseul/public/" style="color: rgb(51, 99, 144); text-decoration: none; outline: none;" target="_blank"><strong>www.ghiseul.ro</strong></a>, prin intermediul caruia se realizeaza platile online, SNEP pune la dispozitia utilizatorilor doua sectiuni, una de plata cu autentificare si una de plata fara autentificare.</p>\n\n<p>Astfel, pentru&nbsp;<span style="color:rgb(128, 0, 0)"><strong>sectiunea de plata cu autentificare,&nbsp;</strong></span>sunt necesare credentiale, adica un nume de utilizator si o parola, care se genereaza automat in momentul in care s-a finalizat procesul de inregistrare in sistem a primariei de care apartine contribuabilul. Numele de utilizator si parola sunt transmise in plic sigilat prin mijloace sigure de catre institutia publica, ulterior inregistrarii in SNEP.</p>\n', 'ghid-de-achitare-a-impozitelor', 157, 1, 1),
(293, '', '', '', 157, 2, 0),
(294, 'Investește în orașul Strășeni', '<h2>&bdquo;Investind &icirc;n educaţie, investim &icirc;n viitorul oraşului!&rdquo;</h2>\n\n<p>&nbsp;&Icirc;n această perioadă premergătoare &icirc;nceperii noului an şcolar, sunt finalizate majoritatea lucrărilor de reabilitare şi modernizare la unităţile de &icirc;nvăţăm&acirc;nt din oraş. Potrivit specialiştilor din cadrul Direcţiei Şcoli a Municipiului, au fost terminate lucrările de hidroizolaţii şi reparaţii şarpante. Au fost executate reparaţii la pardoselile sălilor de sport de la Colegiul Economic &bdquo;Transilvania&rdquo;, Liceul Tehnologic &bdquo;Avram Iancu&rdquo;, Liceul Tehnologic &bdquo;Gheorghe Şincai&rdquo;.</p>\n\n<p>&nbsp; &nbsp; &nbsp; La Şcolile gimnaziale &bdquo;Europa&rdquo; şi Beşa au fost amenajate grupuri sanitare, iar grupul sanitar de la Şcoala Gimnazială &bdquo;Dacia&rdquo; corp A a fost complet reabilitat. Tot aici au fost &icirc;nlocuite sistemele de iluminat convenţionale cu sisteme economice tip LED. T&acirc;mplăria de lemn a fost &icirc;nlocuită cu t&acirc;mplărie PVC la Şcoala Gimnazială &bdquo;George Coşbuc&rdquo; şi la Şcoala generală nr. 7 corp A.</p>\n\n<p>&nbsp; &nbsp; &nbsp;Sunt realizate &icirc;n proporţie de 30% modernizarea şi mansardarea Grădiniţei cu program prelungit nr. 16 &ndash; principala investiţie &ndash; şi au fost demarate lucrări de reabilitare a grupurilor sanitare la Liceul Tehnologic &bdquo;Electromureş&rdquo;, Şcoala Gimnazială &bdquo;Mihai Viteazu&rdquo; şi la Grădiniţa cu program prelungit &bdquo;Paradisul Copilăriei&rdquo;. Totodată, sunt &icirc;n curs de reabilitare aleile pietonale de la Şcoala Gimnazială &bdquo;Europa&rdquo; şi sunt executate lucrări de &icirc;nlocuire a t&acirc;mplăriei de lemn cu t&acirc;mplărie PVC la sala de sport a Liceului Pedagogic &bdquo;Mihai Eminescu&rdquo;. &Icirc;n paralel, se fac verificări tehnice şi reparaţii integrale la centralele termice ale unităţilor de &icirc;nvăţăm&acirc;nt, fiind contractate lucrări de reabilitare a aleilor pietonale la Grădiniţa cu program prelungit nr. 15 şi pentru diferite reparaţii la &icirc;mprejmuirile şcolilor şi grădiniţelor.</p>\n', 'investeste-in-orasul-straseni', 158, 1, 1),
(295, '', '', '', 158, 2, 0);
