(296, 'Cum să întregistrezi o societate comercială?', '<p>O&nbsp;<strong>societate comercială</strong>&nbsp;(<a href="http://ro.wikipedia.org/wiki/Abreviere" style="text-decoration: none; color: rgb(11, 0, 128); background: none;" title="Abreviere">abreviat</a>&nbsp;<strong>S.C.</strong>) reprezintă o&nbsp;<a class="new" href="http://ro.wikipedia.org/w/index.php?title=Asocia%C8%9Bie&amp;action=edit&amp;redlink=1" style="text-decoration: none; color: rgb(165, 88, 88); background: none;" title="Asociație — pagină inexistentă">asociație</a>&nbsp;de&nbsp;<a class="mw-redirect" href="http://ro.wikipedia.org/wiki/Om_de_afaceri" style="text-decoration: none; color: rgb(11, 0, 128); background: none;" title="Om de afaceri">oameni de afaceri</a>&nbsp;alcătuită pe baza unor&nbsp;<a class="new" href="http://ro.wikipedia.org/w/index.php?title=Investi%C8%9Bie&amp;action=edit&amp;redlink=1" style="text-decoration: none; color: rgb(165, 88, 88); background: none;" title="Investiție — pagină inexistentă">investiții</a>&nbsp;de&nbsp;<a href="http://ro.wikipedia.org/wiki/Capital_(economie)" style="text-decoration: none; color: rgb(11, 0, 128); background: none;" title="Capital (economie)">capital</a>, urmărindu-se obținerea unor beneficii comune. Societatea comercială este uneori privită ca subordonată&nbsp;<a class="mw-redirect" href="http://ro.wikipedia.org/wiki/%C3%8Entreprindere" style="text-decoration: none; color: rgb(11, 0, 128); background: none;" title="Întreprindere">&icirc;ntreprinderii</a>&nbsp;(companiei).</p>\n\n<p>Există&nbsp;<strong>societăți &icirc;n nume colectiv</strong>, &icirc;n cazul cărora se asociază un număr mic de persoane &icirc;n vederea &icirc;ntemeierii unei &icirc;ntreprinderi&nbsp;<a href="http://ro.wikipedia.org/wiki/Comer%C8%9B" style="text-decoration: none; color: rgb(11, 0, 128); background: none;" title="Comerț">comerciale</a>&nbsp;sau&nbsp;<a href="http://ro.wikipedia.org/wiki/Industrie" style="text-decoration: none; color: rgb(11, 0, 128); background: none;" title="Industrie">industriale</a>. Contribuția fiecărei persoane este at&acirc;t sub formă de capital, c&acirc;t și de muncă; obligațiile trebuie asumate nelimitat de către toți asociații.</p>\n\n<p>Distincția dintre societate comercială și &icirc;ntreprindere nu este exprimată &icirc;n termeni riguroși. &Icirc;n diferite limbi, societatea poate fi interpretată ca o &icirc;ntreprindere (companie) de mai mici dimensiuni sau chiar ca echivalent al companiei. Limba rom&acirc;nă atestă o delimitare teoretică &icirc;ntre societate și intreprindere, &icirc;nsă practica este aceea de a denumi &icirc;ntreprinderile, laolaltă cu alte asociații &icirc;n interes de afaceri mai mici, &bdquo;societăți comerciale&rdquo;. Sintagma se plasează ca un prefix, &icirc;naintea denumirii &icirc;ntreprinderi (de exemplu, Societatea Comercială (S.C.) <span style="color:#000099">&bdquo;Compania Națională de Transporturi Aeriene Rom&acirc;ne&rdquo;.</span></p>\n\n<p>Astfel, legea definește cinci diferite tipuri de societăți comerciale ce pot fi constituite.</p>\n\n<ul class="crt">\n	<li><a class="new" href="http://ro.wikipedia.org/w/index.php?title=Societate_%C3%AEn_nume_colectiv&amp;action=edit&amp;redlink=1" style="color: rgb(165, 88, 88); text-decoration: none; background: none;" title="Societate în nume colectiv — pagină inexistentă">Societăți &icirc;n nume colectiv</a></li>\n	<li><a class="new" href="http://ro.wikipedia.org/w/index.php?title=Societate_%C3%AEn_comandit%C4%83_simpl%C4%83&amp;action=edit&amp;redlink=1" style="color: rgb(165, 88, 88); text-decoration: none; background: none;" title="Societate în comandită simplă — pagină inexistentă">Societăți &icirc;n comandită simplă</a></li>\n	<li><a class="new" href="http://ro.wikipedia.org/w/index.php?title=Societate_%C3%AEn_comandit%C4%83_pe_ac%C8%9Biuni&amp;action=edit&amp;redlink=1" style="color: rgb(165, 88, 88); text-decoration: none; background: none;" title="Societate în comandită pe acțiuni — pagină inexistentă">Societăți &icirc;n comandită pe acțiuni</a></li>\n	<li><a href="http://ro.wikipedia.org/wiki/Societate_pe_ac%C8%9Biuni" style="color: rgb(11, 0, 128); text-decoration: none; background: none;" title="Societate pe acțiuni">Societăți pe acțiuni</a></li>\n	<li><a href="http://ro.wikipedia.org/wiki/Societate_cu_r%C4%83spundere_limitat%C4%83" style="color: rgb(11, 0, 128); text-decoration: none; background: none;" title="Societate cu răspundere limitată">Societăți cu răspundere limitată</a></li>\n</ul>\n', 'cum-sa-intregistrezi-o-societate-comerciala', 159, 1, 1),
(297, '', '', '', 159, 2, 0),
(298, 'Cum să întregistrezi o gospodărie de fermeri', '<h2>Care este procedura de constituire a gospodăriei ţărăneşti (de fermier)?</h2>\n\n<p>entru constituirea unei gospodării ţărăneşti (de fermier), fondatorii şi potenţialii membri ai acesteia trebuie să &icirc;ntocmească declaraţia de constituire, conţinutul căreia este stabilit de alin. (3), art. 10 al Legii 1353/2000 privind&nbsp;<a href="http://lex.justice.md/index.php?action=view&amp;view=doc&amp;lang=1&amp;id=311579" target="_blank">gospodăriile ţărăneşti (de fermier)</a>. Declaraţia de constituire trebuie autentificată la notar sau la secretarul primăriei.</p>\n\n<p>Pentru &icirc;nregistrarea gospodăriei ţărăneşti, fondatorul trebuie să prezinte la primăria din localitatea unde &icirc;şi are sediul, actele necesare care vor fi supuse unei verificări.</p>\n\n<p>&Icirc;n termen de 7 zile din ziua prezentării documentelor, primăria:</p>\n\n<ul class="crt">\n	<li>va adopta decizia de &icirc;nregistrare a gospodăriei ţărăneşti (de fermier),</li>\n	<li>va efectua &icirc;nscierea datelor &icirc;n Registrul gospodăriilor ţărăneşti şi</li>\n	<li>va elibera certificatul de &icirc;nregistrare sau, după caz, va anunța refuzul &icirc;nregistrării, dacă există vreun temei stabilit de lege (de exemplu: conţinutul actelor prezentate pentru &icirc;nregistrarea gospodăriei ţărăneşti (de fermier) contravin legislaţiei sau conţin date neveridice).</li>\n</ul>\n', 'cum-sa-intregistrezi-o-gospodarie-de-fermeri', 160, 1, 1),
(299, '', '', '', 160, 2, 0),
(300, 'Cum să întregistrezi o întreprindere individuală', '<h2>Ghid practic: Cum infiintezi o intreprindere individuala si ce taxe trebuie sa platesti la stat pentru ea.</h2>\n\n<p>Daca intentionezi sa incepi o afacere mica, poti opta pentru infiintarea unei intreprinderi individuale, insa trebuie sa demonstrezi ca ai o calificare in domeniul de activitate pe care ti l-ai ales. In plus, daca acumulezi datorii, atunci vei raspunde in fata creditorilor cu bunurile proprii. In materialul urmator iti prezentam ce etape trebuie sa parcurgi ca sa infiintezi o intreprindere individuala, ce taxe trebuie sa platesti pentru activitatea prestata si cum tii evidenta contabila. &nbsp; &nbsp;</p>\n\n<h2>Etapele infiintarii unei intreprinderi individuale</h2>\n\n<p>Pentru a infiinta o intreprindere individuala, viitorul titular trebuie sa intocmeasca documentatia necesara pe care sa o depuna la Oficiul Registrului Comertului de pe langa Tribunalul in raza caruia acesta isi stabileste sediul profesional, la ghiseu, prin corespondenta sau prin biroul de asistenta si reprezentare din cadrul primariilor, a declarat pentru AvocatNet.ro avocatul Delia Cozma, din cadrul casei de avocatura Biris Goran.</p>\n\n<p>Prima etapa, prealabila, in procedura de infiintare o reprezinta rezervarea denumirii intreprinderii individuale, prin depunerea la ORCT a cererii de verificare disponibilitate si/sau rezervare firma (original), completata cu trei denumiri, in ordinea preferintelor si achitarea taxei de registru, care in prezent este de 72 lei, a explicat avocatul.</p>\n\n<p>Dovada de rezervare firma se obtine in cursul aceleiasi zile daca cererea de verificare se depune la ghiseul ORCT, a continuat sursa citata.</p>\n\n<p>Important! Numele intreprinderii individuale se compune din numele titularului intreprinderii scris in intregime sau din numele si initiala prenumelui acestuia, la care se adauga sintagma &quot;intreprindere individuala&quot;.</p>\n\n<p>A doua si ultima etapa a infiintarii intreprinderii individuale consta in inregistrarea efectiva la ORCT a cererii de inregistrare si autorizare a functionarii impreuna cu dosarul cuprinzand toate actele necesare pentru infiintarea acesteia, a mai spus Delia Cozma.</p>\n\n<p>&nbsp;</p>\n', 'cum-sa-intregistrezi-o-intreprindere-individuala', 161, 1, 1),
