(308, 'Autorizația de desființare', '<table class="atz" style="border-collapse:collapse; border-spacing:0px; border:1px solid rgb(227, 227, 227); box-sizing:border-box; color:rgb(76, 76, 76); font-family:open_sansregular; font-size:17px; line-height:normal; padding:30px 25px; vertical-align:top">\n	<tbody>\n		<tr>\n			<td style="vertical-align:top; width:66px">1.</td>\n			<td style="vertical-align:top">Scopul serviciului public</td>\n			<td style="vertical-align:top; width:504px">\n			<p>Autorizaţia de funcționare este un act administrativ individual ce atestă dreptul titularului autorizaţiei de a desfăşura activitatea &icirc;n unitatea comercială şi/sau de prestări servicii &icirc;n locul (terenul, localul, incinta) stabilit, pentru o perioadă stabilită, cu respectarea obligatorie a condiţiilor de autorizare prevăzute de legislaţie.</p>\n			</td>\n		</tr>\n		<tr>\n			<td style="vertical-align:top; width:66px">2.</td>\n			<td style="vertical-align:top">Planul &icirc;ncăperii nelocative actualizat</td>\n			<td style="vertical-align:top; width:504px">\n			<ol>\n				<li><a href="http://apl.localhost/page/markup/autorizatii" style="box-sizing: border-box; color: rgb(124, 77, 124);">Cerere tipzată (descarcă)</a></li>\n				<li>Extrasul din Registrul de stat al persoanelor juridice și &icirc;ntreprinzătorilor individuali;</li>\n				<li>Certificatul de proprietate asupra imobilului cu destinaţie nelocativă, eliberat de către Oficiul cadastral teritorial. Pentru unităţile amplasate &icirc;n &icirc;ncăperi &icirc;nchiriate urmează să fie prezentat şi contractul de locaţiune;</li>\n				<li>Planul &icirc;ncăperii nelocative actualizat la OCT;</li>\n				<li>Schema de amplasare a unităţii comerciale (pentru gherete, tarabe şi alte unităţi mobile);</li>\n				<li>Contractul de locaţiune sau titlul de autentificare a deţinătorului de teren;</li>\n				<li>Autorizaţia sanitară de funcţionare, pentru toate tipurile de unităţi comerciale şi/sau prestare servicii, iar &icirc;n cazul auto