şi/sau prestare servicii, iar &icirc;n cazul autorizării magazinelor alimentare şi unităţilor de alimentaţie publică suplimentar şi asortimentul produselor comercializate; Autorizaţia sanitară veterinară de funcţionare</li>\n			</ol>\n			</td>\n		</tr>\n		<tr>\n			<td style="vertical-align:top; width:66px">3.</td>\n			<td style="vertical-align:top">hj gjghj gfh jghj ghf hjghjfg h</td>\n			<td style="vertical-align:top; width:504px">\n			<p>dtf yghdgfhgfh dfgh hgdtf yghdgfhgfh dfgh hgdtf yghdgfhgfh dfgh hgdtf yghdgfhgfh dfgh hgdtf yghdgfhgfh dfgh hgdtf yghdgfhgfh dfgh hgdtf yghdgfhgfh dfgh hgdtf yghdgfhgfh dfgh hgdtf yghdgfhgfh dfgh hgdtf yghdgfhgfh dfgh hgdtf yghdgfhgfh dfgh hgdtf yghdgfhgfh dfgh hgdtf yghdgfhgfh dfgh hgdtf yghdgfhgfh dfgh hgdtf yghdgfhgfh dfgh hgdtf yghdgfhgfh dfgh hgdtf yghdgfhgfh dfgh hgdtf yghdgfhgfh dfgh hgdtf yghdgfhgfh dfgh hgdtf yghdgfhgfh dfgh hgdtf yghdgfhgfh dfgh hgdtf yghdgfhgfh dfgh hgdtf yghdgfhgfh dfgh hgdtf yghdgfhgfh dfgh hgdtf yghdgfhgfh dfgh hgdtf yghdgfhgfh dfgh hgdtf yghdgfhgfh dfgh hgdtf yghdgfhgfh dfgh hgdtf yghdgfhgfh dfgh hgdtf yghdgfhgfh dfgh hgdtf yghdgfhgfh dfgh hgdtf yghdgfhgfh dfgh hgdtf yghdgfhgfh dfgh hgdtf yghdgfhgfh dfgh hgdtf yghdgfhgfh dfgh hgdtf yghdgfhgfh dfgh hgdtf yghdgfhgfh dfgh hgdtf yghdgfhgfh dfgh hgdtf yghdgfhgfh dfgh hgdtf yghdgfhgfh dfgh hgdtf yghdgfhgfh dfgh hgdtf yghdgfhgfh dfgh hgdtf yghdgfhgfh dfgh hgdtf yghdgfhgfh dfgh hgdtf yghdgfhgfh dfgh hgdtf yghdgfhgfh dfgh hgdtf yghdgfhgfh dfgh hgdtf yghdgfhgfh dfgh hgdtf yghdgfhgfh dfgh hgdtf yghdgfhgfh dfgh hg</p>\n			</td>\n		</tr>\n	</tbody>\n</table>\n', 'certificate-necesare-pentru-constructia-casei-sau-a-unui-obiectiv-comercial', 169, 1, 1),
