tps://mts0.googleapis.com/vt?pb=!1m4!1m3!1i15!2i18994!3i11505!2m3!1e0!2sm!3i274000000!3m9!2sro-RO!3sUS!5e18!12m1!1e47!12m3!1e37!2m1!1ssmartmaps!4e0!20m1!1b1" style="-webkit-transform:translateZ(0px); -webkit-user-select:none; border:0px; box-sizing:border-box; height:256px; margin:0px; padding:0px; vertical-align:middle; width:256px" /></div>\n</div>\n</div>\n</div>\n\n<div style="box-sizing: border-box; position: absolute; left: 0px; top: 0px; z-index: 2; width: 870.390625px; height: 310px;">&nbsp;</div>\n\n<div style="box-sizing: border-box; position: absolute; left: 0px; top: 0px; z-index: 3; width: 870.390625px; transform-origin: 471px 222px 0px; transform: matrix(1, 0, 0, 1, 0, 0);">\n<div style="box-sizing: border-box; -webkit-transform: translateZ(0px); position: absolute; left: 0px; top: 0px; z-index: 104; width: 870.390625px;">&nbsp;</div>\n\n<div style="box-sizing: border-box; -webkit-transform: translateZ(0px); position: absolute; left: 0px; top: 0px; z-index: 105; width: 870.390625px;">&nbsp;</div>\n\n<div style="box-sizing: border-box; -webkit-transform: translateZ(0px); position: absolute; left: 0px; top: 0px; z-index: 106; width: 870.390625px;">&nbsp;</div>\n\n<div style="box-sizing: border-box; -webkit-transform: translateZ(0px); position: absolute; left: 0px; top: 0px; z-index: 107; width: 870.390625px;">&nbsp;</div>\n</div>\n</div>\n\n<div style="box-sizing: border-box; margin-left: 5px; margin-right: 5px; z-index: 1000000; position: absolute; left: 0px; bottom: 0px;">\n<div style="box-sizing: border-box; width: 62px; height: 26px; cursor: pointer;"><a href="http://maps.google.com/maps?ll=47.142731,28.653508&amp;z=15&amp;t=m&amp;hl=ro-RO&amp;gl=US&amp;mapclient=apiv3" style="box-sizing: border-box; text-decoration: none; position: static; overflow: visible; float: none; display: inline;" target="_blank" title="Faceţi clic pentru a vizualiza această zonă pe Hărţi Google"><img src="https://maps.gstatic.com/mapfiles/api-3/images/google_white2.png" style="-webkit-user-select:none; border:0px; box-sizing:border-box; height:26px; left:0px; margin:0px; padding:0px; position:absolute; top:0px; vertical-align:middle; width:62px" /></a></div>\n</div>\n</div>\n</div>\n\n<div class="city_dt" style="box-sizing: border-box; margin-bottom: 25px; border-bottom-width: 1px; border-bottom-style: solid; border-bottom-color: rgb(236, 236, 236); padding: 5px 0px;">\n<p>Orașul Strășeni</p>\n\n<p>Strada Ștefan cel Mare 24, MD 2034</p>\n</div>\n\n<p>Orașul Strășeni este situat la 23 km de Chișinău, &icirc;n direcția nord-vest, pe malul r&acirc;ului B&acirc;c. Orașul este amplasat &icirc;n regiunea de codri a Moldovei.</p>\n\n<p>Suprafața totală a orașului Strășeni este de 60,82 km&sup2;, dintre care circa 1 156 ha sunt terenuri cu destinație agricolă. Relieful este format din coline, versanți, văi și c&acirc;mpii.</p>\n\n<p>Clima este temperat&ndash;continentală. Temperatura medie de iarnă este de 6, &ndash;7 &deg;C, iar temperatura medie de vară este de 35,5 &deg;C.</p>\n\n<p>Orășelul cu această denumire e menționat documentar ca sat la 20 martie 1545, c&acirc;nd Alexandru Voievod, domnul Moldovei, confirmă mănăstirii Pobrata o jumătate de moșie pe care călugării o aveau &icirc;n dar de la jup&acirc;neasa Frățiman cu satul Curluceni. La 4 iulie 1774 &icirc;l aflăm &icirc;n stăp&acirc;nirea mănăstirii Frumoasa, cu 84 de gospodării cu răzeși și mazili. Orașul avea 2 preoți, biserica a fost construită &icirc;n anul 1785, alături de alta veche. Sat mare și frumos, &icirc;n anul 1870 aici erau 596 gospodării, 1840 bărbați și 1110 femei. Gospodarii țineau prisăci, vii și livezi frumoase, erau lemnari, t&acirc;mplari vestiți. La 6 ianuarie 1873 zemstva județeană trimite la Strășeni primul medic cu studii superioare, pe doctorul Feodor Constantinovichi Scordeli. La 1 iulie 1877 satul avea o bibliotecă sătească, uar &icirc;n anul 1910 avea 2 școli și o biserică.</p>\n</div>\n</div>\n', 'cum-sa-ajungi-in-oras-amplasarea-geografica', 181, 1, 1),
