(342, 'Istoria orașul', '<p>Orășelul cu această denumire e menționat documentar ca sat la 20 martie 1545, c&acirc;nd Alexandru Voievod, domnul Moldovei, confirmă mănăstirii Pobrata o jumătate de moșie pe care călugării o aveau &icirc;n dar de la jup&acirc;neasa Frățiman cu satul Curluceni. La 4 iulie 1774 &icirc;l aflăm &icirc;n stăp&acirc;nirea mănăstirii Frumoasa, cu 84 de gospodării cu răzeși și mazili. Orașul avea 2 preoți, biserica a fost construită &icirc;n anul 1785, alături de alta veche. Sat mare și frumos, &icirc;n anul 1870 aici erau 596 gospodării, 1840 bărbați și 1110 femei. Gospodarii țineau prisăci, vii și livezi frumoase, erau lemnari, t&acirc;mplari vestiți. La 6 ianuarie 1873 zemstva județeană trimite la Strășeni primul medic cu studii superioare, pe doctorul Feodor Constantinovichi Scordeli. La 1 iulie 1877 satul avea o bibliotecă sătească, uar &icirc;n anul 1910 avea 2 școli și o biserică.</p>\n\n<p>Din spusele celui mai bătr&acirc;n locuitor din oraș I. Țurcanu &icirc;n v&acirc;rstă de 98 de ani, care a auzit din mărturisirile</p>\n\n<p><img src="http://localhost/apps/frontend/views/templates/Default/assets/img/logo.png" style="border:0px; box-sizing:border-box; color:rgb(34, 34, 34); font-family:open_sansregular; font-size:16px; line-height:22.3999996185303px; margin:15px 0px 35px; vertical-align:middle" /></p>\n\n<p>Din spusele celui mai bătr&acirc;n locuitor din oraș I. Țurcanu &icirc;n v&acirc;rstă de 98 de ani, care a auzit din mărturisirile bunicului său, că undeva pe dealul Coșnei, un oarecare Teofan, străger, a construit o casă &icirc;n care stăteau străgerii ce vegheau Chișinăul. Cu toți străgerii conducea &icirc;nsăși Teofan. Odată cu apariția localității, de la cuv&acirc;ntul străgeri s-a tras toponimul Strășeni.</p>\n\n<p>Localitatea, &icirc;ncep&acirc;nd cu a doua jumătate a sec. XX, s-a dezvoltat intens, devenind un centru industrial important din republică.</p>\n\n<p>&Icirc;n orașul Strășeni sunt &icirc;nregistrați circa 2780 agenți economici, dintre care cel mai mare număr &icirc;l constituie gospodăriile țărănești &ndash; 1.590. &Icirc;ntreprinderile cu dreptul de persoane juridice alcătuiesc 305 unități. Un loc de frunte ocupă industria alimentară, mai ales cea vinicolă. Strășeniul se bucură de un spectru bogat al celor mai bune soiuri de poamă europeană: Aligote, Pinot, Cabernet, Izabelle, Risling de Italia, coniacuri, din care se obține șampanie, vinuri seci ordinare și dulci de calitate superioară și sucuri naturale. Partea industrială a orașului este amplasată &icirc;n regiunea de nord-vest a orașului și este despărțită de sectorul locativ prin calea ferată. Punctul de vinificație, secția de cărămidă a fabricii de materiale de construcție se află &icirc;n partea de nord a orașului. &Icirc;n domeniul comerțului activează 96 &icirc;ntreprinderi, sistemul de alimentație publică este format de 25 &icirc;ntreprinderi. Deservirea socială este asigurată de 17 unități de deservire.</p>\n\n<p>&Icirc;n oraș activează filiale ale 3 bănci comerciale și ale 2 companii de asigurare.</p>\n\n<p>Este dezvoltată producția de vinuri: . Se produc conserve din fructe și legume și produse de panificație. Fabrica materialelor de construcție produce țiglă roșie, faianță. La 6 km spre sud-vest funcționează antena TV de l&acirc;ngă Strășeni.</p>\n', 'istoria-orasul', 182, 1, 1),
