(354, 'Programează-te on-line pentru o audiență', '<p>Pentru programarea audiențelor vă rugăm să transmiteți o scurtă prezentare a problemei ce urmează a fi discutată, precum și datele dvs. de contact la adresa de e-mail: relpubl@casan.ro.</p>\n\n<p>Totodată, puteți să vă adresați telefonic Biroului de Relații cu Asigurații la nr. de telefon: 0372.309.236.</p>\n\n<p>Confirmarea programării audienței va fi facută telefonic la numărul de telefon indicat de dvs. o Receptionarea documentelor, care urmeaza a fi examinate &icirc;n termen de &ndash; 1 ora, 24 ore, 5 zile si 15 zile, se va realize fara programare prealabila.</p>\n\n<p>[person_subscribe]</p>\n', 'programeaza-te-on-line-pentru-o-audienta-1', 188, 1, 1),
