(486, ' Doresc sa-mi reintregesc familia pe teritoriul Moldovei!', '<p><span style="color:rgb(75, 75, 75); font-family:open_sanssemibold; font-size:14px">Potrivit legii azilului din Rom&acirc;nia, &icirc;n conformitate cu prevederile Convenţiei de la Geneva din 1951, statutul de refugiat se recunoaşte, la cerere, cetăţeanului străin care, &icirc;n urma unei temeri bine &icirc;ntemeiate de a fi persecutat pe motive de rasă, religie, naţionalitate, opinii politice sau apartenenţă la un anumit grup social, se află &icirc;n afara ţării de origine şi care nu poate sau, datorită acestei temeri, nu doreşte protecţia acestei ţări, precum şi persoanei fără cetăţenie care, fiind &icirc;n afara ţării &icirc;n care &icirc;şi avea reşedinţa obişnuită datorită aceloraşi motive menţionate mai sus, nu poate sau, datorită respectivei temeri, nu doreşte să se re&icirc;ntoarcă.</span></p>\n', '-doresc-sa-mi-reintregesc-familia-pe-teritoriul-moldovei-1', 254, 1, 1),
(487, '', '', '', 254, 2, 0),
