(1164, 'Dreptul la ajutor social', '<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">Dreptul la ajutor social &icirc;l au familiile defavorizate, membrii cărora s&icirc;nt cetăţeni ai Republicii Moldova, cetăţeni ai altor state, apatrizi sau refugiaţi, care au domiciliu &icirc;n Republica Moldova, conform legislaţiei.</span></p>\n\n<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">De dreptul la ajutor social beneficiază familia defavorizată &icirc;n cazul &icirc;n care toţi membrii adulţi ai acesteia se &icirc;ncadrează &icirc;n cel puţin una din următoarele situaţii:</span></p>\n\n<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">a) au atins v&icirc;rsta necesară pentru stabilirea pensiei conform legislaţiei;</span></p>\n\n<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">b) s&icirc;nt persoane &icirc;ncadrate &icirc;n grade de invaliditate;</span></p>\n\n<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">c) s&icirc;nt şomeri &icirc;nregistraţi la agenţia teritorială pentru ocuparea forţei de muncă &icirc;n a cărei rază teritorială &icirc;şi au domiciliul şi care nu refuză un loc de muncă corespunzător sau participarea la serviciile de stimulare a ocupării forţei de muncă oferite de agenţii;</span></p>\n\n<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">d) &icirc;ngrijesc un copil mai mic de 3 ani;</span></p>\n\n<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">e) &icirc;ngrijesc un membru/membri ai familiei &icirc;ncadraţi &icirc;n gradul I de invaliditate care necesită &icirc;ngrijire, conform concluziei Consiliului de Expertiză Medicală a Vitalităţii, &icirc;ngrijesc un copil/copii invalizi din aceeaşi familie sau o persoană &icirc;n v&icirc;rstă de peste 75 ani din aceeaşi familie, conform concluziei Consiliului Medical Consultativ.</span></p>\n\n<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">Familiile ai căror membri realizează venituri provenite din salarizare, cu timp integral sau parţial, sau din activitatea de antreprenoriat, pot solicita acordarea dreptului la ajutor social, cu condiţia că ceilalţi membri adulţi ai acesteia se &icirc;ncadrează &icirc;n situaţiile expuse la prezentul punct.</span></p>\n\n<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">Situaţiile specificate la lit. d) şi e) pct.3 din prezentul Regulament pot fi invocate doar de un singur membru al familiei.</span></p>\n\n<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">La determinarea dreptului la ajutorul social se exclud membrii familiei, care:</span></p>\n\n<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">a) deţin cetăţenia Republicii Moldova, &icirc;nsă nu se află pe teritoriul acesteia&nbsp; mai mult de 3 luni consecutiv;</span></p>\n\n<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">b) execută pedeapsa privativă de libertate;</span></p>\n\n<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">c) satisfac serviciul militar &icirc;n termen;</span></p>\n\n<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">d) se află la &icirc;ntreţinerea statului: aziluri, internate, pensionate, alte forme de plasament temporar sau permanent.</span></p>\n', 'dreptul-la-ajutor-social', 275, 1, 1),
