(1168, 'Depunerea cererii', '<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">Pentru determinarea dreptului la ajutor social, solicitantul sau reprezentantul legal al familiei, trebuie să depună cerere pentru acordarea ajutorului social (anexa nr.1 la prezentul Regulament).</span></p>\n\n<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">Membrul desemnat de familie pentru depunerea cererii de ajutor social (solicitantul), este ales &icirc;n mod voluntar dintre membrii cu capacitate deplină de exerciţiu, iar alegerea acestuia este dovedită prin semnăturile aplicate pe cererea de solicitare a ajutorului social de către toţi membrii adulţi ai familiei.</span></p>\n\n<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">&Icirc;mpreună cu cererea, solicitantul prezintă, &icirc;n mod obligatoriu, certificatul privind componenţa familiei, actul de identitate, &icirc;nsoţit de copia acestuia, precum şi legitimaţia de şedere temporară sau actul de identitate, eliberat de autorităţile competente, &icirc;n cazul cetăţenilor străini, apatrizilor sau refugiaţilor, iar, după caz, următoarele acte confirmative &icirc;n copie:</span></p>\n\n<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">a) certificatul de naştere al copilului;</span></p>\n\n<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">b) decizia de instituire a tutelei/curatelei;</span></p>\n\n<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">c) decizia de plasament &icirc;n instituţie;</span></p>\n\n<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">d) certificatul de salariu de la locul de muncă;</span></p>\n\n<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">e) certificatul privind tipul de studii pe care le urmează orice membru al familiei (cu finanţare bugetară sau prin contract) cu indicarea mărimii bursei, după caz;</span></p>\n\n<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">f) confirmarea de efectuare a plăţii pensiei de &icirc;ntreţinere;</span></p>\n\n<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">g) certificatul privind perioada de satisfacere a serviciului militar &icirc;n termen;</span></p>\n\n<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">h) actele de proprietate privind terenurile agricole de pe l&icirc;ngă casă (intravilanul localităţilor), precum şi din extravilanul localităţilor;</span></p>\n\n<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">i) contractul de arendă, locaţiune;</span></p>\n\n<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">j) actul ce confirmă gradul şi termenul invalidităţii/severităţii.</span></p>\n\n<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">Cererea va conţine acordul pentru colectarea şi verificarea informaţiei despre familie, veniturile şi proprietatea acesteia, precum şi obligaţiunea de a restitui sumele primite nelegitim, &icirc;n cazul declaraţiei false sau incomplete.</span></p>\n\n<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">Cererea pentru acordarea ajutorului social, &icirc;nsoţită de actele confirmative, se depune reprezentantului direcţiei/secţiei asistenţă socială şi protecţie a familiei din localitatea unde familia solicitantă &icirc;şi are domiciliul, pentru a fi transmisă direcţiei/secţiei asistenţă socială şi protecţia familiei.</span></p>\n\n<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">Reprezentantul direcţiei/secţiei asistenţă socială şi protecţie a familiei verifică informaţia indicată şi actele anexate la cerere, &icirc;n conformitate cu prevederile punctului 8 al prezentului Regulament.</span></p>\n\n<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">Cererea, prezentată cu toate actele confirmative necesare, se acceptă şi se &icirc;nregistrează de către reprezentantul direcţiei/secţiei asistenţă socială şi protecţie a familiei &icirc;ntr-un registru special. Solicitantului i se eliberează o&nbsp; recipisă de primire a cererii, indic&icirc;ndu-se data şi numărul de &icirc;nregistrare. &Icirc;n cazul &icirc;n care nu au fost prezentate toate actele confirmative necesare, cererea nu se acceptă.</span></p>\n', 'depunerea-cererii', 276, 1, 1),
