(1171, '', '', '', 276, 7, 0),
(1172, 'Determinarea venitului lunar minim garantat', '<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">Cuantumul venitului lunar minim garantat al familiei reprezintă suma cuantumurilor veniturilor lunare minime garantate stabilite pentru fiecare membru al acestei familii.</span></p>\n\n<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">Cuantumul venitului lunar minim garantat pentru fiecare membru al familiei se stabileşte după cum urmează:</span></p>\n\n<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">a) 100% din venitul lunar minim garantat pentru solicitant;</span></p>\n\n<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">b) 70% din venitul lunar minim garantat pentru fiecare alt membru adult al familiei;</span></p>\n\n<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">c) 50 % din venitul lunar minim garantat pentru fiecare copil;</span></p>\n\n<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">d) plus 30% din venitul lunar minim garantat pentru fiecare adult &icirc;ncadrat &icirc;ntr-un grad de invaliditate;</span></p>\n\n<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">e) plus 50% din venitul lunar minim garantat pentru fiecare copil invalid;</span></p>\n\n<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">f) plus 10% din venitul lunar minim garantat, dacă persoana &icirc;ncadrată &icirc;ntr-un grad de invaliditate este unicul adult din familie.</span></p>\n', 'determinarea-venitului-lunar-minim-garantat', 277, 1, 1),
