(1174, '', '', '', 277, 6, 0),
(1175, '', '', '', 277, 7, 0),
(1176, 'Determinarea şi calcularea venitului global mediu lunar al familiei', '<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">Pentru determinarea venitului global mediu lunar al familiei, toate veniturile şi economiile se declară, indiferent de provenienţa acestora.</span></p>\n\n<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">Venitul global mediu lunar al familiei se calculează din veniturile totale, curente şi nete obţinute, sau calculate pentru luna anterioară celei &icirc;n care a fost depusă cererea de acordare a ajutorului social. Veniturile nete s&icirc;nt veniturile din care au fost achitate impozitul pe venit şi alte plăţi obligatorii. Pensia de &icirc;ntreţinere plătită este exclusă din veniturile familiei.</span></p>\n\n<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">La calcularea venitului global mediu lunar al familiei s&icirc;nt luate &icirc;n considerare, următoarele tipuri de venituri:</span></p>\n\n<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">a) veniturile sezoniere, ocazionale, cele obţinute din activitatea agricolă a gospodăriilor ţărăneşti (de fermier) şi &icirc;n gospodăriile casnice auxiliare;</span></p>\n\n<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">b) toate tipurile de pensii şi prestaţii sociale care se plătesc mai rar dec&icirc;t o dată &icirc;n lună, indiferent de organul care a stabilit plata;</span></p>\n\n<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">c) remitenţele de la membrii familiei sau de la alte persoane din ţară sau de peste hotare;<br />\nd) plăţile pentru descoperiri, invenţii, mostre industriale şi propuneri de raţionalizare, precum şi din drepturile de autor şi drepturile conexe;</span></p>\n\n<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">e) ajutorul financiar de la persoane fizice şi juridice;</span></p>\n\n<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">f) plăţile din prestarea serviciilor &icirc;n baza unui contract civil;</span></p>\n\n<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">g) indemnizaţia unică pentru tinerii specialişti, angajaţi la lucru, conform repartizării &icirc;n instituţiile de &icirc;nvăţăm&icirc;nt, instituţiile ocrotirii sănătăţii, asistenţei sociale, ştiinţifice şi celor din cultură şi artă;</span></p>\n\n<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">h) orice economii &icirc;n monedă naţională sau străină, indiferent de locul sau modul &icirc;n care s&icirc;nt păstrate;</span></p>\n\n<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">i) veniturile obţinute din moştenire sau donaţie;</span></p>\n\n<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">j) veniturile obţinute din c&icirc;ştiguri la loterie;</span></p>\n\n<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">k) veniturile obţinute din operaţiuni comerciale cu bunurile mobile şi imobile ce le aparţin cu drept de proprietate membrilor familiei;</span></p>\n\n<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">l) veniturile obţinute din burse, burse de studiu sau alte plăţi, indiferent de forma de &icirc;nvăţăm&icirc;nt;</span></p>\n\n<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">m) veniturile obţinute din drepturile salariale de la locul principal de muncă şi din munca prin cumul, inclusiv indemnizaţiile unice şi veniturile din desfăşurarea oricărui tip de activitate de antreprenoriat;</span></p>\n\n<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">n) veniturile obţinute din pensiile de &icirc;ntreţinere;</span></p>\n\n<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">o) veniturile obţinute din toate tipurile de pensii şi prestaţii sociale lunare (compensaţii, indemnizaţii, alocaţii etc.), indiferent de organul care a stabilit plata.</span></p>\n\n<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">La calcularea venitului global mediu lunar al familiei următoarele tipuri de venit nu se iau &icirc;n considerare:</span></p>\n\n<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">a) indemnizaţia unică la naşterea copilului;</span></p>\n\n<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">b) ajutorul oferit la deces;</span></p>\n\n<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">c) plăţile oferite la lichidarea consecinţelor calamităţilor naturale sau situaţiilor excepţionale;</span></p>\n\n<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">d) cheltuielile de deplasare (&icirc;n limitele normelor stabilite de Guvern);</span></p>\n\n<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">e) indemnizaţia unică de &icirc;ncadrare a şomerilor, &icirc;n baza contractului individual de muncă, &icirc;n localităţile situate la o distanţă de 30 km de la localitatea &icirc;n care &icirc;şi au domiciliul, egală cu un salariu mediu pe economie pentru anul precedent;</span></p>\n\n<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">f) indemnizaţia unică de instalare a şomerilor care se &icirc;ncadrează, &icirc;n baza contractului individual de muncă, &icirc;ntr-o altă localitate, egală cu 3 salarii medii pe economie pentru anul precedent.</span></p>\n', 'determinarea-si-calcularea-venitului-global-mediu-lunar-al-familiei', 278, 1, 1),
(1177, '', '', '', 278, 2, 0),
(1178, '', '', '', 278, 6, 0),
(1179, '', '', '', 278, 7, 0),
(1180, 'Obligaţiile beneficiarilor de ajutor social', '<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">Solicitantul ajutorului social este obligat să prezinte informaţii complete şi veridice, &icirc;naint&icirc;nd actele justificative respective.<br />\nSolicitantul ajutorului social are obligaţia să comunice &icirc;n scris reprezentantului direcţiei/secţiei asistenţă socială şi protecţie a familiei orice modificare intervenită &icirc;n informaţia declarată iniţial &icirc;n cererea de acordare a ajutorului social, &icirc;n termen de 10 zile de la data la care a intervenit modificarea.</span></p>\n\n<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">La expirarea termenului pentru care a fost stabilit sau pentru revizuirea dreptului la ajutor social, solicitantul &icirc;nştiinţează &icirc;n scris reprezentantul direcţiei/secţiei asistenţă socială şi protecţie a familiei despre faptul că de la solicitare sau de la ultima &icirc;nştiinţare nu au intervenit schimbări cu privire la componenţa familiei, veniturile sau proprietatea acesteia. Faptul &icirc;n cauză&nbsp; constituie temei pentru revizuirea şi reconfirmarea dreptului şi continuarea plăţii ajutorului social, &icirc;n caz contrar acesta &icirc;ncetează.</span></p>\n\n<p style="text-align:justify"><span style="font-family:verdana,geneva,sans-serif">Beneficiarul are obligaţia de a permite efectuarea anchetei sociale stabilite de direcţia/secţia asistenţă socială şi protecţie a familiei pentru a verifica condiţiile care au stat la baza acordării dreptului la ajutor social. &Icirc;n caz de refuz a efectuării anchetei sociale se &icirc;ntocmeşte un&nbsp; proces-verbal.</span></p>\n', 'obligatiile-beneficiarilor-de-ajutor-social', 279, 1, 1),
(1181, '', '', '', 279, 2, 0),
(1182, '', '', '', 279, 6, 0),
(1183, '', '', '', 279, 7, 0);
